import React, { useState } from 'react';
import './App.css';
import ContadorCaracteres from './ContadorCaracteres';
import VerificacaoLogin from './VerificacaoLogin';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  const handleLogin = () => {
    setIsAuthenticated(true);
  };

  return (
    <div className="App">
      <h1>Minha Aplicação React</h1>
      {isAuthenticated ? (
        <ContadorCaracteres />
      ) : (
        <VerificacaoLogin onLogin={handleLogin} />
      )}
    </div>
  );
}

export default App;
